import { createApp } from "vue";
import App from "./App.vue";
createApp(App).mount("#app");
import MisaDialog from "./components/base/Dialog.vue";
import WarningNotify from "./components/base/WarningNotify.vue"
import MisaExclamation from "./components/base/Exclamation.vue"

const app = createApp(App)
app.component("m-dialog",MisaDialog)
app.mount('#app')
